var external=function(){var t=function(n){n.stopPropagation();n.preventDefault()};return{stop:t}}();(function(){if(!navigator.geolocation)document.getElementById("map_canvas").innerHTML="No Geolocation Support.";else{var n,t={mapTypeId:google.maps.MapTypeId.ROA};n=new google.maps.Map(document.getElementById("map_canvas"),t);navigator.geolocation.getCurrentPosition(function(t){var i=new google.maps.LatLng(t.coords.latitude,t.coords.longitude),r=new google.maps.InfoWindow({map:n,position:i,latitude:$("#latitude").val(t.coords.latitude),longitude:$("#longitude").val(t.coords.longitude),content:'<span><i class="fa fa-pin"><\/i><\/span><span>Latitude: '+t.coords.latitude+"<\/span><\/br><span>Longitude: "+t.coords.longitude+"<\/span>"});n.setCenter(i)})}})();